import React from "react";
import styled from "styled-components";
import Tag from "./Tag";
import { COLORS, SPACING, GRAYSCALE } from "./Global Styles/styles";

const CardWrapper = styled.div`
    position: relative;
    min-height: 400px;
    min-width: 300px;
    background: ${COLORS.typeGrass};
    border-radius: ${SPACING.small};
    box-shadow: 5px 5px 10px ${GRAYSCALE.lightGray};
    z-index: 1;
`;

const CardArea = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: ${SPACING.base};
`;

const CardTitle = styled.div`
    display: flex;
    width: 100%;
`;

const TitleName = styled.h2`
    flex: 1;
    align-items: flex-start;
    font-family: 'Poppins', sans-serif;
    color: white;
`;

const TitleNumber = styled.h3`
    display: flex;
    align-items: center;
    align-items: center;
    justify-content: center;
    font-family: 'Poppins', sans-serif;
    color: white;
`;

const PokemonImage = styled.div`
    border: 0;
    margin-bottom: ${SPACING.tiny};
`;

const Image = styled.div`
    justify-content: center;
    align-items: center;
    width: 150px;
    height: 150px;
    background-image: url("001.png");
    background-size: cover;
    z-index: 3;
`;

const CardInfo = styled.div`
    bottom: 5px;
    left: 50%;
    transform: translateX(-50%);
    position: absolute;
    height: 240px;
    width: 290px;
    background: white;
    border-radius: ${SPACING.small};
    z-index: -1;
`;

const InformationWrapper = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    font-family: 'Poppins', sans-serif;
    margin-top: ${SPACING.mini};
`;

const InformationHeader = styled.h3`
    color: ${COLORS.typeGrass};
`;

const InformationMeasurements = styled.div`
    display: flex;
    margin-top: ${SPACING.mini};
`;

const Measurement = styled.div`
    display: flex;
    justify-content: space-around;
    padding-top: ${SPACING.small};
`;

const Divider = styled.hr`
    height: 48px;
    margin: 0px ${SPACING.base} 0px ${SPACING.base};
`;

const Card = () => {
    return(
        <CardWrapper>
            <CardArea>
                <CardTitle>
                    <TitleName>Bulbasaur</TitleName>
                    <TitleNumber>#001</TitleNumber>
                </CardTitle>
                <PokemonImage>
                    <Image/>
                </PokemonImage>
                <Tag type="Grass" color={ COLORS.typeGrass }/>
                <InformationWrapper>
                    <InformationHeader>About</InformationHeader>
                    <InformationMeasurements>
                        <Measurement>
                            <svg width="16" height="16" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M14 2H11.9747C11.0609 0.793125 9.62719 0 8 0C6.37281 0 4.93906 0.793125 4.02531 2H2C0.897187 2 0 2.89719 0 4V14C0 15.1028 0.897187 16 2 16H14C15.1028 16 16 15.1028 16 14V4C16 2.89719 15.1028 2 14 2ZM8 1C10.2091 1 12 2.79094 12 5C12 7.20906 10.2091 9 8 9C5.79094 9 4 7.20906 4 5C4 2.79094 5.79094 1 8 1ZM15 14C15 14.5522 14.5522 15 14 15H2C1.44781 15 1 14.5522 1 14V4C1 3.44781 1.44781 3 2 3H3.42375C3.15437 3.61344 3 4.28813 3 5C3 7.75688 5.24312 10 8 10C10.7569 10 13 7.75688 13 5C13 4.28813 12.8456 3.61344 12.5763 3H14C14.5522 3 15 3.44781 15 4V14ZM8 8C8.82719 8 9.5 7.32719 9.5 6.5C9.5 6.065 9.31094 5.67625 9.01437 5.40219L9.95938 3.19688C10.0681 2.94344 9.95063 2.64938 9.69656 2.54063C9.44406 2.43187 9.14906 2.54906 9.04031 2.80344L8.09469 5.00969C6.98656 4.9375 6.5 5.89531 6.5 6.5C6.5 7.32719 7.17281 8 8 8ZM8 6C8.27625 6 8.5 6.22375 8.5 6.5C8.5 6.77625 8.27625 7 8 7C7.72375 7 7.5 6.77625 7.5 6.5C7.5 6.22375 7.72375 6 8 6Z" fill="#212121"/></svg>
                            <h5>6,9kg</h5>
                        </Measurement>
                        <Divider />
                        <Measurement>
                            <svg width="16" height="16" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M14 2H11.9747C11.0609 0.793125 9.62719 0 8 0C6.37281 0 4.93906 0.793125 4.02531 2H2C0.897187 2 0 2.89719 0 4V14C0 15.1028 0.897187 16 2 16H14C15.1028 16 16 15.1028 16 14V4C16 2.89719 15.1028 2 14 2ZM8 1C10.2091 1 12 2.79094 12 5C12 7.20906 10.2091 9 8 9C5.79094 9 4 7.20906 4 5C4 2.79094 5.79094 1 8 1ZM15 14C15 14.5522 14.5522 15 14 15H2C1.44781 15 1 14.5522 1 14V4C1 3.44781 1.44781 3 2 3H3.42375C3.15437 3.61344 3 4.28813 3 5C3 7.75688 5.24312 10 8 10C10.7569 10 13 7.75688 13 5C13 4.28813 12.8456 3.61344 12.5763 3H14C14.5522 3 15 3.44781 15 4V14ZM8 8C8.82719 8 9.5 7.32719 9.5 6.5C9.5 6.065 9.31094 5.67625 9.01437 5.40219L9.95938 3.19688C10.0681 2.94344 9.95063 2.64938 9.69656 2.54063C9.44406 2.43187 9.14906 2.54906 9.04031 2.80344L8.09469 5.00969C6.98656 4.9375 6.5 5.89531 6.5 6.5C6.5 7.32719 7.17281 8 8 8ZM8 6C8.27625 6 8.5 6.22375 8.5 6.5C8.5 6.77625 8.27625 7 8 7C7.72375 7 7.5 6.77625 7.5 6.5C7.5 6.22375 7.72375 6 8 6Z" fill="#212121"/></svg>
                            <h5>6,9kg</h5>
                        </Measurement>
                    </InformationMeasurements>
                </InformationWrapper>
            </CardArea>
            <CardInfo />
        </CardWrapper>
    );
}

export default Card;
